import React from 'react';
import { css } from 'emotion'

const AboutMe = () => {
    return (
    <div id={"here"} className={styles.container}>
        <p className={styles.aboutme}>I am a Full Stack Software Engineer with a background as a Math Teacher and in business. I am passionate about solving algorithms and user experience. Click below to know a little about my background</p>
    </div>
    )
}

const styles = {
    aboutme: css`
    font-size: 23px;
    text-align: left;
    text-decoration: none;
    // text-indent: 50px;
    margin-left: 55px;
    margin-top: 40px;
    line-height: 26pt;
    text-transform: uppercase;
    `,
    container: css`
    width: 700px;

    `
}


export default AboutMe;
